os.atribuicoes14:
•Encaminhar Termo de Referência da Ação Educacional a ESC;
•Definir o público do evento em conjunto com a Presidência;
•Enviar ofícios para Prefeitos e Secretários de Saúde e demais Autoridades;
•Definir programação;
•Encaminhar programação para Comunicação para diagramação;
•Verificar a possibilidade de uso do Plenário do TCE-MT para transmissão do encontro;
•Encaminhar programação para ESC e demais unidades envolvidas;
•Supervisionar o planejamento e a execução da Ação Educacional;
•Encaminhar CI/Convite para Membros, Procuradores e todas as unidades em conjunto com o Gabinete da Presidência;
•Definir em conjunto com o cerimonial, o dispositivo de honra;
•Aprovar o roteiro em conjunto com cerimonial;
•Encaminhar cópias dos ofícios para a ESC e Cerimonial;
•Encaminhar para o Núcleo de Cerimonial cópias dos CI´s, para confirmação de presença;
•Encaminhar mini currículo dos painelistas a SECOM e Cerimonial;
•Orçar despesas da Ação Educacional;
•Solicitar compra de passagem e hospedagem para palestrante;
•Encaminhar a lista de painelistas e palestrantes que necessitarão de transporte;
•Encaminhar a lista de painelistas e palestrantes que irão estacionar na frente da ESC;
•Solicitar os slides das apresentações aos painelistas e encaminhar para ESC até o dia 31/10/2024.

os.atribuicoes12:
•Receber a demanda da Ação Educacional;
•Compartilhar com o Conselheiro supervisor a demanda recebida;
•Criar link de inscrição;
•Definir equipe de trabalho;
•Elaborar e acompanhar a matriz de responsabilidades, o checklist e demais documentos necessários;
•Gerenciar a ação educacional quanto aos aspectos operacionais, logísticos e de divulgação;
•Encaminhar diariamente a lista de inscritos para a Comissão permanente de Saúde e Assistência Social do TCE-MT;
•Solicitar serviço de coffee break;
•Organizar a montagem dos materiais da Ação Educacional: pastas, canetas e blocos de rascunho;
•Organizar sala de Pessoas Importantes;
•Solicitar Intérprete de libras;
•Providenciar som ambiente no foyer, durante coffee break;
•Solicitar canetas;
•Providenciar transporte dos palestrantes e painelistas;
•Encaminhar para o Gabinete Militar, a lista das painelistas e palestrantes para reserva espaço de estacionamento na frente da Escola;
•Liberar Certificado aos participantes

